  Files({
      int id, 
      int userId, 
      dynamic libraryCategoryId, 
      String name, 
      String type, 
      String createdAt, 
      String updatedAt, 
      String fileUrl, 
      String size, 
      Used_in usedIn, 
      List<dynamic> share, 
      List<Fav> fav, 
      List<Talkingpoints> talkingpoints, 
      List<Decisions> decisions, 
      List<Actions> actions}){
    _id = id;
    _userId = userId;
    _libraryCategoryId = libraryCategoryId;
    _name = name;
    _type = type;
    _createdAt = createdAt;
    _updatedAt = updatedAt;
    _fileUrl = fileUrl;
    _size = size;
    _usedIn = usedIn;
    _share = share;
    _fav = fav;
    _talkingpoints = talkingpoints;
    _decisions = decisions;
    _actions = actions;
}

  Files.fromJson(dynamic json) {
    _id = json['id'];
    _userId = json['user_id'];
    _libraryCategoryId = json['library_category_id'];
    _name = json['name'];
    _type = json['type'];
    _createdAt = json['created_at'];
